import React from "react";
import { Input } from "antd";

const Username = () => {
  return (
    <div className="inner-auth">
      <h2>Choose a username</h2>
      <Input />
      <button type="submit" className="login-btn custom-btn">
        <span>Submit</span>
      </button>
    </div>
  );
};

export default Username;
